import { Routes, Route, Outlet } from "react-router-dom";

import Home from "./routes/home/home.component";

const App = () => {
  return (
    <Routes>
      <Route path="/" element={<Home />}>
        <Route path="shop" element={<Home />} />
        {/* {/shop}  */}
      </Route>
    </Routes>
  );
};

export default App;
